example copied from their README:

```
var sock = new SockJS('http://mydomain.com/my_prefix');
sock.onopen = function() {
    console.log('open');
};
sock.onmessage = function(e) {
    console.log('message', e.data);
};
sock.onclose = function() {
    console.log('close');
};

sock.send('test');
sock.close();
```

